import React from "react";
import "./HomePage.css";

const HomePage = ({ user }) => {
  const { userName } = user;
  const firstName = userName.split(" ").slice(0, 1);
  return (
    <div>
      <header>Welcome {firstName}!</header>
    </div>
  );
};

export default HomePage;
